import Add from './components/Add/Add';
// import Add from './components/Add/Add'
function App() {
  return (
    <div className="App">
      <Header/>
      <Routes>
        {/* <Route path='/add' element={<Add/>}/> */}
      <Route path='/' element={<Watchlist/>}/>
      <Route path='/watched' element={<Watched/>}/>
      <Route path='/add' element={<Add/>}/>
      </Routes>
    </div>
  );
}

export default App;
